import React from 'react';
import {storiesOf} from '@storybook/react-native';
import {Dashboard} from '../../src/app/screens/dashboard';
import {Provider} from 'react-redux';
import {createStore, combineReducers} from 'redux';

const getStore = (token = 'WLO') => createStore(combineReducers({
    settings: () => ({
        baseCurrency: 'GBP'
    }),
    exchange: () => ({
        exchange: {
            XLM: 0.3936,
            BTC: 0.0000147,
            ETH: 0.00025584,
            EUR: 0.102828,
            USD: 0.12,
            JPY: 13.8984,
            GBP: 0.091956,
            GOLD: 0.0031452
        }
    }),
    wollo: () => ({
        balances: {
            WLO: '10',
            XLM: '20',
        },
        balance: '0',
        balanceXLM: '0',
        selectedToken: token,
    }),
    kids: () => ({
        sendError: null
    }),
    keys: () => ({
        publicKey: ''
    }),
    config: () => ({
        network: 'mainnet'
    }),
}));

const props = {
    dispatch: () => {},
    navigation: {
        push: () => {},
        navigate: () => {},
        addListener: () => {},
        isFocused: () => {},
        state: {
            key: 'SCREEN_DASHBOARD',
            routeName: 'SCREEN_DASHBOARD'
        },
        actions: {}
    },
    error: null,
    exchange: {
        XLM: 0.3936,
        BTC: 0.0000147,
        ETH: 0.00025584,
        EUR: 0.102828,
        USD: 0.12,
        JPY: 13.8984,
        GBP: 0.091956,
        GOLD: 0.0031452
    },
    // balance: '100',
    balanceXLM: '50',
    hasGas: true,
    baseCurrency: 'USD',
    escrow: null,
    firstTime: false,
    kids: [],
    balances: {
        WLO: '10',
        XLM: '20',
    },
};

export const kids = [{
    name: 'Ella',
    dob: '01/01/2010',
    photo: 'data:image/jpeg;base64,',
    address: 'GD5Q7KRFQC3Q7YQPYAZ4G65B65EBCJOVSHPE65MIYQMCLUQULQDKBLUX',
    balance: '20',
    goals: [],
    tasks: [],
}, {
    name: 'Sebastian',
    dob: '01/01/2010',
    photo: null,
    address: 'GAG6MT2Q4II2JHZI67QP2FHBTV7WAQ3NWVKVASDQHR7DPSP7H3HBVEQA',
    balance: '17',
    goals: [],
    tasks: [],
}];

storiesOf('Dashboard')
    .addDecorator(story => <Provider store={getStore()}>{story()}</Provider>)
    .add('default view', () => (
        <Dashboard {...props}/>
    ))
    .add('with kids', () => (
        <Dashboard {...{
            ...props,
            kids
        }}/>
    ))
    .add('with kids 17 balance', () => (
        <Dashboard {...{
            ...props,
            kids,
            balance: '17',
        }}/>
    ))
    .add('with big balance', () => (
        <Dashboard {...{
            ...props,
            kids,
            balance: '10000000',
        }}/>
    ))
    .add('inactive', () => (
        <Dashboard {...{
            ...props,
            balance: '0',
            balanceXLM: '0',
            hasGas: false,
            firstTime: false,
        }}/>
    ))
    .add('with kid not funded message', () => (
        <Dashboard {...{
            ...props,
            kids: [{
                ...kids[0],
                balance: 0,
            }],
            balance: '0',
            balanceXLM: '0',
            hasGas: false,
            firstTime: false,
            showFundingMessage: true,
        }}/>
    ))
    .add('first time', () => (
        <Dashboard {...{...props, firstTime: true}}/>
    ))
    .add('kids funding message', () => (
        <Dashboard {...{...props,
            showKidAddFundingMessage: true,
            balance: '0',
            balanceXLM: '0',
        }}/>
    ))
    .add('loading', () => (
        <Dashboard {...{...props, exchange: null}}/>
    ))
    .add('error', () => (
        <Dashboard {...{...props, exchange: null, error: new Error('Network error')}}/>
    ));

storiesOf('Dashboard')
    .addDecorator(story => <Provider store={getStore('XLM')}>{story()}</Provider>)
    .add('xlm view', () => (
        <Dashboard {...{
            ...props,
            selectedToken: 'XLM',
            balance: '50',
        }}/>
    ))
    .add('xlm view (0 balance)', () => (
        <Dashboard {...{
            ...props,
            selectedToken: 'XLM',
            balance: '0',
        }}/>
    ));
